-- ***************************************************
-- *****************TABLES****************************
-- ***************************************************
CREATE TABLE user (
  id INTEGER PRIMARY KEY AUTO_INCREMENT,
  fname VARCHAR(200) NOT NULL,
  lname VARCHAR(200) NOT NULL,
  uname VARCHAR(200) UNIQUE NOT NULL,
  image_url VARCHAR(400),
  pass VARCHAR(200) NOT NULL -- we don't care about security in dummy apps
);
CREATE TABLE permission (
  id INTEGER PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(200) NOT NULL,
  description VARCHAR(4096)
);
CREATE TABLE user_permission (
  user_id INTEGER NOT NULL,
  permission_id INTEGER NOT NULL,
  PRIMARY KEY (user_id, permission_id),
  FOREIGN KEY (user_id) REFERENCES user(id) ON DELETE CASCADE ON UPDATE NO ACTION,
  FOREIGN KEY (permission_id) REFERENCES permission(id) ON DELETE CASCADE ON UPDATE NO ACTION
);
CREATE TABLE project (
  id INTEGER PRIMARY KEY AUTO_INCREMENT,
  creator_id INTEGER NOT NULL,
  name VARCHAR(200) NOT NULL,
  description VARCHAR(4096),
  created_utc DATETIME NOT NULL,
  FOREIGN KEY (creator_id) REFERENCES user(id) ON DELETE CASCADE ON UPDATE NO ACTION
);
CREATE TABLE build (
  id INTEGER PRIMARY KEY AUTO_INCREMENT,
  project_id INTEGER NOT NULL,
  triggered_by INTEGER NOT NULL,
  started_utc DATETIME NOT NULL,
  ended_utc DATETIME NOT NULL,
  success INTEGER DEFAULT 0, -- -1 fail, 0 unknown, 1 success
  logs VARCHAR(4096),
  FOREIGN KEY (project_id) REFERENCES project(id) ON DELETE CASCADE ON UPDATE NO ACTION
);
CREATE TABLE report (
    id INTEGER PRIMARY KEY AUTO_INCREMENT,
    creator_id INTEGER NOT NULL,
    name VARCHAR(200) NOT NULL,
    type VARCHAR(200) NOT NULL,
    description VARCHAR(4096),
    data VARCHAR(4096),
    created_utc DATETIME NOT NULL,
    FOREIGN KEY (creator_id) REFERENCES user(id) ON DELETE CASCADE ON UPDATE NO ACTION
);
